//lua data
const {LuaWasm, LuaEngine} = await import('data:application/javascript;charset=utf-8;base64,');
const LuaLib = await LuaWasm.initialize(`data:application/wasm;base64,`);
//loading lua
// === Lua Worker Skeleton (runcode + vmstate, with self-logging) ===

// Wasmoon Lua engine
let lua = new LuaEngine(LuaLib, {});
let canRunLUA = false;

// Empty util (for later use)
let util = null;

// Format JS-to-Lua results
const formatRes = (res) => {
    if (res === '') return '[empty String]';
    if (res === true) return '[boolean True]';
    if (res === false) return '[boolean False]';
    if (res === null) return '[empty Null]';
    if (res === undefined) return '[empty Undefined]';
    if (typeof res === 'object') {
        if (Array.isArray(res)) return '[object Array]';
        return '[object Object]';
    }
    if (typeof res === 'function') return '[object Function]';
    if (typeof res === 'number') return `[number ${res}]`;
    return `[string|empty <\n${res}\n>]`;
};

// Safe JSON parse helper
function _parseJSON(obj) {
    if (Array.isArray(obj)) return {};
    if (typeof obj === 'object') return obj;
    try {
        obj = JSON.parse(obj);
        if (Array.isArray(obj)) return {};
        if (typeof obj === 'object') return obj;
        return {};
    } catch {
        return {};
    }
}

// Internal log helper: worker -> main
function mainLog(message) {
    self.postMessage({ type: 'mainlog', value: message });
}

// Handle messages from main thread
self.onmessage = async (e) => {
    const msg = e.data;

    switch (msg.type) {
        case 'runcode':
            if (!canRunLUA) {
                mainLog('Attempted to run code but VM is off.');
                self.postMessage({ type: 'error', value: 'Lua engine not ready.' });
                return;
            }
            try {
                let result = await lua.doString(msg.value);
                self.postMessage({ type: 'result', value: formatRes(result) });
                mainLog('Executed Lua code successfully.');
            } catch (err) {
                self.postMessage({ type: 'error', value: err.message });
                mainLog(`Lua error: ${err.message}`);
            }
            break;

        case 'vmstate':
            if (!msg.value) {
                self.postMessage({ type: 'error', value: 'vmstate requires a value (on, off, reset, toggle).' });
                return;
            }
            switch (msg.value.toLowerCase()) {
                case 'on':
                    canRunLUA = true;
                    self.postMessage({ type: 'status', value: 'Lua VM turned ON.' });
                    mainLog('VM state switched ON.');
                    break;
                case 'off':
                    canRunLUA = false;
                    self.postMessage({ type: 'status', value: 'Lua VM turned OFF.' });
                    mainLog('VM state switched OFF.');
                    break;
                case 'reset':
                    canRunLUA = false;
                    lua = new LuaEngine(LuaLib, {});
                    canRunLUA = true;
                    self.postMessage({ type: 'status', value: 'Lua VM reset and turned ON.' });
                    mainLog('VM state RESET.');
                    break;
                case 'toggle':
                    canRunLUA = !canRunLUA;
                    self.postMessage({ type: 'status', value: `Lua VM toggled to ${canRunLUA ? 'ON' : 'OFF'}.` });
                    mainLog(`VM state toggled to ${canRunLUA ? 'ON' : 'OFF'}.`);
                    break;
                default:
                    self.postMessage({ type: 'error', value: `Unknown vmstate value: ${msg.value}` });
            }
            break;

        default:
            self.postMessage({ type: 'error', value: `Unknown message type: ${msg.type}` });
    }
};
